import React from "react";
import { Link } from "react-router-dom";

const Card = ({ article }) => {
  const imageUrl =
    process.env.NODE_ENV !== "development"
      ? article.image.url
      : process.env.REACT_APP_BACKEND_URL + article.image.url;
  return (
        <div>
          <div class="container">
            <div class="row">
              <div class="col-md-8">
                <div class="card mb-4">
                  <h2>{article.title}</h2>
                  <img
                    src={imageUrl}
                    alt={article.image.url}
                    height="100"
                  />
                </div>
              </div>
            </div>
          </div>
        </div>
  );
};

export default Card;
